import React from 'react';
import './App.css';
import Search from './components/Wiki';

function App() {
  return (
    <div className="App">
      <div className="jumbotron">
        <p className="lead text-center">Rick and Morty Wiki</p>

        <Search />
      </div>
    </div>
  );
}

export default App;
